window.bookSummaryJSON = "<p>When Kora Williams wakes up inside the dark alien warship called Silence, fate has spun completely out of her control.</p> <p>She doesn't understand why she was abducted by a vicious, depraved Kordolian, and she can't believe she was rescued by an even more dangerous one. A big armor-clad brute of a warrior, who lifted her into his arms far too easily, as if she weighed next to nothing.</p> <p>She should be dead, or at the very least, doomed to a terrible life as a slave.</p> <p>But she's been saved, and now she's on a ship full of dangerous silver-skinned aliens and their surprisingly human mates. She wants nothing to do with this strange new reality. She doesn't want to dwell on her horrific ordeal. All she wants to do is return to a normal life on Earth; to her cozy little house, her job, her son . . .</p> <p>But these Kordolians have other ideas. To her dismay, it turns out there's a reason she was taken.</p> <p>And the big, lethal warrior who rescued her? He's been assigned to protect her.</p> <p>Contains mature themes.</p>"; 
